CARI 'TETESCHI',NON TOCCATE L'ITALIA 
-leggo DER SPIEGEL,italiani scrocconi aggressivi,i mendicanti almeno dicono grazie quando gli si da qualcosa.
Ora, al di la del fatto che il saldo dell'italia nei confronti dell'europa Ã¨ negativo, ossia paghiamo di piÃ¹ di quanto riceviamo, cari tedeschi, come potete permettervi di offendere cosi un intero popolo?
-voi che nemmeno i romani hanno ritenuto proficuo civilizzarvi,mentre per lavarvi il culo andavate ancora nei fiumi;
-voi che dopo le invasioni barbariche invece di apprezzare l'uso di terme,acquedotti,li avete semplicemente distrutti facendo ripiombare l'europa tutta in quell'epoca chiamata medioevo o EVO OSCURO;
-voi che imponete con arroganza e saccenza le vostre idee, e 2 guerre mondiali sono ancora li a ricordarcelo;
-voi che pretendete il pagamento dei debiti quando per tirarvi su il morale i vostri vi sono stati condonati,anzi,quelli della prima guerra mondiale vi siete rifiutati di pagarli;
-voi che al di la del lavoro che avete in una germania con regole europee costruite a pro,per vedere la vera bellezza venite in italia,altro che i nibelunghi;
-ma soprattutto voi che porca zozza siete l'unico popolo che ho conosciuto che mette LA MARMELLATA SUGLI SPAGHETTI.

